import {
    DropdownButton,
    Button
} from 'react-bootstrap';
import {
    container as style_container
} from './index.module.css';

const Toolbox = ({
    year,
    type,
    search,
    button
}) => {
    return <div
        className={style_container}
    >
        {
            year && year.data ?
                <DropdownButton id={year.id} title={year.title}>
                    {
                        year.data.map((item, index) => {
                            return <Dropdown.Item key={year.key+index}>{item.value}</Dropdown.Item>
                        })
                    }
                </DropdownButton>
            :
                null
        }
        {
            type && type.data ?
                <DropdownButton id={type.id} title={type.title}>
                    {
                        type.data.map((item, index) => {
                            return <Dropdown.Item key={type.key+index}>{item.value}</Dropdown.Item>
                        })
                    }
                </DropdownButton>
            :
                null
        }
        {
            button ?
                <input
                    type="text"
                    value={search.value}
                    onChange={search.onChange}
                    {...search.props}
                />
            :
                null
        }
        <Button
            {...button}
        />
    </div>
};
export default Toolbox;
